import React from "react";
import { StyleSheet, Text, View, TextInput, Button } from "react-native";
import colors from "../ThemeColor.js";

const styles = StyleSheet.create({
  container: {
    margin: 20,
    display: "flex",
    alignItems: "center",
  },
  top: {
    display: "flex",
    flexDirection: "row",
    justifyContent: "space-between",
    marginTop: 40,
    marginLeft:0,
    marginRight:0,
    width: "100%",
  },
  notification_container: {
    flex: 1,
    float: "left",
  },
  username_container: {
    flex: 1,
    display: "flex",
    flexDirection: "row",
    justifyContent: "center",
    alignItems: "center",
  },
  settings_container: {
    flex: 1,
    float: "right",
  },

  balance_container: {
    marginTop: 20,
    display: "flex",
  },
});

export default styles;
